import React from 'react';
import './JokeOfTheWeek.css';

const JokeOfTheWeek = (props) => {
  return (
    <div className="joke-of-the-week-container">
      <h2 className="joke-of-the-week-title">{props.title}</h2>
      <p className="joke-of-the-week-text">{props.joke}</p>
    </div>
  );
}

export default JokeOfTheWeek;
